import React from 'react';

const AboutUsPage = () => {
  return (
    <div>
      <h1>About Us</h1>
      <p>Welcome to our website! We are dedicated to providing the best deals and coupons for our users.</p>
      <p>Our team works tirelessly to find the latest discounts and promotions, ensuring that you save money on your purchases.</p>
      <p>Feel free to explore our website and take advantage of the amazing deals and coupons available.</p>
    </div>
  );
};

export default AboutUsPage;
